import React from 'react'

const ChartButtons = ({children, selected, OnClick}) => {

  const handleClick = () => {
    if (OnClick) {
      OnClick();
    }
  };

  return (
    <span OnClick={handleClick} className={`chart-button ${selected ? 'active' : ''}`}>
        {children}
    </span>
  )
}

export default ChartButtons
